import React, {useState} from 'react';
import './header.css';


const Header = () => {
    const Theme_light = "/assets/sol.png";
    const Theme_dark = "/assets/lua.png";



    const Mudar_tema = () => {
        if (light_dark_theme == Theme_light){
            setLightDarkTheme(Theme_dark);
            setBackgroundHeader("header_theme_light");
        } else{
            setLightDarkTheme(Theme_light);
            setBackgroundHeader("header_theme_dark");
        }

    }

    return (
        <header className={background_header}>
            <div className="area-pesquisa">
                <div className='icons_1'>
                    <a href="#">
                        <img id="logo" 
                             src="/assets/future.png" 
                             alt="Logo" 
                             title="Logo-Marca"
                        />
                    </a>
                    <input id="input_pesquisar"
                           type='text' 
                           placeholder='Pesquisar'
                    />
                    <button id="button-search">
                        <img id="img-button" 
                             src="/assets/lupa.png" 
                             alt="Pesquisar" 
                             title="Pesquisar"
                        />
                    </button>
                </div>
            </div>
            <div className='area-user-config'>
                <div className='icons'>
                    <a href="#"
                       onClick={Mudar_tema}
                    >
                        <img id="config" 
                             src={light_dark_theme} 
                             alt="Config" 
                             title="Configurações"
                        />
                    </a>
                    <a href="#">
                        <img id="img-user" 
                             src="/assets/user_2.png" 
                             alt="Usuário" 
                             title="Usuário"
                        />
                    </a>
                </div>
            </div>
        </header>
    );
}

export default Header;
